// import classes from './like.module.css'


const Like = (props) => {
    const [users, setUsers] = useState([])

    useEffect(()=>{

        const allKeys = Object.keys(localStorage)

        for (let i=0; i<allKeys; i++)
        {
            if (allKeys[i].substring(-7)!=="dislike")
            {
                setUsers([...users], allKeys[i])
            }
        }

